import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
const Project = () => {
  return (
    <div id="projects">
      <div className="text-center grid grid-cols-1 hd">
       
        <div className="border-2 border-sky-500 hover:border-t-4">
          <h2>Android App</h2>
          <p>A blood group searching and donour app in your city</p>
          <p>This app was made with Java as Backend and XMl fronend</p>
        </div>
      </div>
    </div>
  );
};
export default Project;
